import React, { useState } from "react";
import { auth, provider, signInWithPopup, signOut } from "../firebase";
import { useNavigate } from "react-router-dom";
import lgs from "../assets/lgs.jpg";

const GoogleLogin = () => {
  const [user, setUser] = useState(null);
  const [showHospitals, setShowHospitals] = useState(false);
  const navigate = useNavigate();

  const hospitals = [
    "Guntur General Hospital",
    "Palnadu Super Specialty Hospital",
    "NRI Medical College",
    "Kamineni Hospitals",
    "Sai Priya Hospital",
    "Sri Sai Hospital",
    "Life Care Hospital"
  ];

  const signInWithGoogle = async () => {
    try {
      const result = await signInWithPopup(auth, provider);
      setUser(result.user);
      alert(`Welcome ${result.user.displayName}`);
    } catch (error) {
      console.error("Google Sign-In Error:", error.message);
    }
  };

  const handleLogout = async () => {
    try {
      await signOut(auth);
      setUser(null);
      alert("Logged out successfully!");
    } catch (error) {
      console.error("Logout Error:", error.message);
    }
  };

  const toggleHospitals = () => {
    setShowHospitals(!showHospitals);
  };

  return (
    <div style={styles.mainContainer}>
      <div style={styles.header}>
        <div style={styles.leftSection}>
          <img src={lgs} alt="Logo" style={styles.logo} />
          <h1 style={styles.title}>Happy Doctors Consultancy</h1>
        </div>

        <div style={styles.rightSection}>
          <div style={styles.dropdownWrapper}>
            <button 
              onClick={toggleHospitals} 
              style={styles.hospitalsButton}
              onBlur={() => setTimeout(() => setShowHospitals(false), 200)}
            >
              Hospitals in Palnadu
              {showHospitals ? ' ▲' : ' ▼'}
            </button>
            {showHospitals && (
              <div style={styles.dropdownContent}>
                {hospitals.map((hospital, index) => (
                  <div 
                    key={index} 
                    style={styles.hospitalItem}
                    onMouseDown={(e) => e.preventDefault()}
                  >
                    {hospital}
                  </div>
                ))}
              </div>
            )}
          </div>
          
          {!user ? (
            <button 
              onClick={signInWithGoogle} 
              style={styles.button}
            >
              Sign in with Google
            </button>
          ) : (
            <button 
              onClick={handleLogout} 
              style={styles.button}
            >
              Logout
            </button>
          )}
        </div>
      </div>

      {user && (
        <div style={styles.profileContainer}>
          <div style={styles.profile}>
            <img 
              src={user.photoURL} 
              alt="Profile" 
              style={styles.avatar} 
              onError={(e) => {
                e.target.onerror = null; 
                e.target.src = "https://via.placeholder.com/100";
              }}
            />
            <h3 style={styles.userName}>{user.displayName}</h3>
            <p style={styles.userEmail}>{user.email}</p>
            <button 
              onClick={() => navigate("/healthcard")} 
              style={styles.cardButton}
            >
              Happy Doctors Card
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

const styles = {
  mainContainer: {
    width: "100%",
    padding: "20px",
    boxSizing: "border-box",
    maxWidth: "1200px",
    margin: "0 auto",
  },

  header: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    width: "100%",
    padding: "20px 30px",
    backgroundColor: "lightgreen",
    borderRadius: "15px",
    boxShadow: "0 4px 12px rgba(0,0,0,0.1)",
    flexWrap: "nowrap",
    overflow: "hidden",
    position: "relative",
  },

  leftSection: {
    display: "flex",
    alignItems: "center",
    gap: "30px",
    minWidth: 0,
    flex: 1,
  },

  rightSection: {
    display: "flex",
    alignItems: "center",
    gap: "25px",
    flexShrink: 0,
  },

  logo: {
    width: "90px",
    height: "90px",
    borderRadius: "50%",
    objectFit: "cover",
    flexShrink: 0,
    border: "4px solid white",
    boxShadow: "0 2px 6px rgba(0,0,0,0.1)",
  },

  title: {
    fontSize: "clamp(24px, 2.5vw, 32px)",
    fontWeight: "bold",
    margin: 0,
    whiteSpace: "nowrap",
    overflow: "hidden",
    textOverflow: "ellipsis",
    flex: 1,
    minWidth: 0,
    color: "#333",
    textShadow: "1px 1px 3px rgba(0,0,0,0.1)",
  },

  dropdownWrapper: {
    position: "relative",
    zIndex: 10,
  },

  hospitalsButton: {
    backgroundColor: "#5a6268",
    color: "white",
    padding: "14px 24px",
    fontSize: "18px",
    border: "none",
    borderRadius: "10px",
    cursor: "pointer",
    whiteSpace: "nowrap",
    boxShadow: "0 3px 6px rgba(0,0,0,0.1)",
    transition: "all 0.3s ease",
    display: "flex",
    alignItems: "center",
    gap: "8px",
    "&:hover": {
      backgroundColor: "#4a545a",
      transform: "translateY(-2px)",
      boxShadow: "0 5px 10px rgba(0,0,0,0.15)",
    },
    "&:active": {
      transform: "translateY(0)",
